server <- function(input,output,session) {  # ,session -- needed for updateSelectInput?
  
  ## establish reactiveValues variables
  values <- reactiveValues( newxlsxfilepath = NA  )  # , lab_df_update = NA , newxlsxfilepath2 = NA length_sites = 0, , lab_df_update = NA,  newxlsxfilepath2 = NA, , lab_samp_chosen = list()

  
  ## read-in Excel file
  dat <- reactive({     # this is called using 'dat()'
    # input$file1 will be NULL initially
    inFile <- input$file1
    if (is.null(inFile)) {
      return(NULL)
        
    } else {
        
      # work-around for read_excel() from readxl package
      #https://stackoverflow.com/questions/30624201/read-excel-in-a-shiny-app
      #file.rename(inFile$datapath,
      #            paste(inFile$datapath, ".xlsx", sep=""))
      
      # Needs to be adapted as above scenario is for one-off read_excel() straight into renderTable 
      
      file.copy(from=inFile$datapath, to=paste0(inFile$datapath,".xlsx"),overwrite = F)
        
      isolate({
        values$newxlsxfilepath <- paste0(inFile$datapath,".xlsx")
      })
      
      new <- list()
      
      
      ### Project
      # # # # # # # # # # # # # # # # # # #
      p <- read_excel(path=values$newxlsxfilepath, range = "Project!B4:C14", col_names = FALSE )
      p <- as.data.frame(p)
      
      ###testfile <- "D:/STOR/PROJ/SALI_PROJECTS/Site Data_NEW_WEB_DB/Bulk_Data_Entry_Scoping/App_prototype/Rfiles/bulkimport-v7 - single input template/NEW-SITES-Bulk-data-import-template-v7.xlsx"
      ###p <- read_excel(path=testfile, range = "Project!B4:C14", col_names = FALSE)
      ###p <- as.data.frame(p)
      
      names(p) <- c("Project attributes","Details")
      
      new[["project"]] <- p
      
      # translate dataframe for export
      p_df_ex <- as.data.frame( matrix(ncol = dim(p)[1] ) )
      names(p_df_ex) <- p[,1]
      p_df_ex[1,] <- p[,2]
      
      for (i in 1:dim(p_df_ex)[2]) {
        #i<-1
        newname_idx <- which( vrt$BulkAppLabel[which(vrt$DBTable == "PROJECTS")] == names(p_df_ex)[i] )
        if (length(newname_idx)>=1) {
          names(p_df_ex)[i] <- vrt$DBName[which(vrt$DBTable == "PROJECTS")][newname_idx]
        }
        print(paste0("completed ",i))
      }
      
      # write order for key fields:
      # idx1: proj_sa_agency_name
      # idx2: proj_code
      # idx3: proj_name
      idx1 <- which(names(p_df_ex) == "proj_sa_agency_name")
      idx2 <- which(names(p_df_ex) == "proj_code")
      idx3 <- which(names(p_df_ex) == "proj_name")
      rest <- c(1:length(names(p_df_ex)))[-c(idx1,idx2,idx3)]
      # rearrange order
      p_df_ex <- p_df_ex[ ,c(idx1,idx2,idx3,rest)]
      
      write.csv(x = p_df_ex,file=paste0(getwd(),"/",p_df_ex$proj_code,"-project-details.csv"), row.names = FALSE)
      
      new[["project acronym"]] <- p_df_ex$proj_code

      
      ### Members
      # # # # # # # # # # # # # # # # # # #
      ###m_df <- read_excel(path=testfile, sheet="Members", col_names = TRUE, skip = 2)
      m_df <- read_excel(path=values$newxlsxfilepath, sheet="Members", col_names = TRUE, skip = 2)
      m_df <- as.data.frame(m_df)
      
      new[["members"]] <- m_df
      
      # translate dataframe for export
      m_df_ex <- m_df
      
      for (i in 1:dim(m_df_ex)[2]) {
        newname_idx <- which( vrt$BulkAppLabel[which(vrt$DBTable == "PROJECTS")] == names(m_df_ex)[i] )
        names(m_df_ex)[i] <- vrt$DBName[which(vrt$DBTable == "PROJECTS")][newname_idx]
      }
      
      # add leading columns for: 
      # proj_sa_agency_name
      # proj_code
      # proj_name
      
      # bind columns in reverse order - so last added is first
      m_df_ex <- cbind(proj_name = p_df_ex$proj_name, m_df_ex)
      m_df_ex <- cbind(proj_code = p_df_ex$proj_code, m_df_ex)
      m_df_ex <- cbind(proj_sa_agency_name = p_df_ex$proj_sa_agency_name, m_df_ex)
      
      write.csv(x = m_df_ex,file=paste0(getwd(),"/",p_df_ex$proj_code,"-project-members.csv"), row.names = FALSE)
      
      
      
      ### Site observations
      # # # # # # # # # # # # # # # # # # #
      ###so_df <- read_excel(path=testfile, sheet="Site observations", col_names = TRUE, skip = 6)
      
      so_df <- read_excel(path=values$newxlsxfilepath, sheet="Site observations", col_names = TRUE, skip = 6)
      so_df <- as.data.frame(so_df)
      
      # trim Example row # 2
      so_df <- so_df[-1, ]
      # trim junk 1st column
      so_df <- so_df[ ,-1]
      
      # trim excess rows at bottom
      rem_rows <- which(is.na(so_df$`S ID`))
      if (length(rem_rows)>0) { so_df <- so_df[-rem_rows, ] }
      
      new[["site-obs"]] <- so_df
      
      # translate dataframe for export
      so_df_ex <- so_df
      
      CHECK_THESE_TABLES <- c("SITES","OBSERVATIONS","MICRORELIEFS", "SURF_CONDITIONS", "SURF_COARSE_FRAGS", "ROCK_OUTCROPS", "DISTURBANCES")
      
      for (i in 1:dim(so_df_ex)[2]) {
        newname_idx <- which( vrt$BulkAppLabel[which(vrt$DBTable %in% CHECK_THESE_TABLES )] == names(so_df_ex)[i] )
        if (length(newname_idx)==1) {
          names(so_df_ex)[i] <- vrt$DBName[which(vrt$DBTable %in% CHECK_THESE_TABLES )][newname_idx]
        }
      }
      
      ## All fields starting with 's' go to SITES table
      sel_var_idx <- grep(pattern = "^s_", x=names(so_df_ex))
      
      sites_df_ex <- so_df_ex[,sel_var_idx]
      # add leading columns for: 
      # proj_sa_agency_name
      # proj_code
      # proj_name
      
      # bind columns in reverse order - so last added is first
      sites_df_ex <- cbind(proj_name = p_df_ex$proj_name, sites_df_ex)
      sites_df_ex <- cbind(proj_code = p_df_ex$proj_code, sites_df_ex)
      sites_df_ex <- cbind(proj_sa_agency_name = p_df_ex$proj_sa_agency_name, sites_df_ex)
      
      write.csv(x = sites_df_ex,file=paste0(getwd(),"/",p_df_ex$proj_code,"-sites.csv"), row.names = FALSE)
      
      
      ## All fields starting with 'o' go to OBSERVATIONS table + s_id
      sel_var_idx <- grep(pattern = "^o_", x=names(so_df_ex))
      
      obs_df_ex <- so_df_ex[,sel_var_idx]
      # add leading columns for: 
      # proj_sa_agency_name
      # proj_code
      # proj_name
      
      # bind columns in reverse order - so last added is first
      obs_df_ex <- cbind(s_id = so_df_ex$s_id, obs_df_ex)
      obs_df_ex <- cbind(proj_name = p_df_ex$proj_name, obs_df_ex)
      obs_df_ex <- cbind(proj_code = p_df_ex$proj_code, obs_df_ex)
      obs_df_ex <- cbind(proj_sa_agency_name = p_df_ex$proj_sa_agency_name, obs_df_ex)
      
      write.csv(x = obs_df_ex, file=paste0(getwd(),"/",p_df_ex$proj_code,"-observations.csv"), row.names = FALSE)
      
      
      ### "MICRORELIEFS"
      
      ## All fields starting with mr go to MICRORELIEFS table
      sel_var_idx <- grep(pattern = "^mr_", x=names(so_df_ex))
      
      microrelief_df_ex <- so_df_ex[,sel_var_idx]
      # add leading columns for: 
      # proj_sa_agency_name
      # proj_code
      # proj_name
      # s_id
      # o_id
      # mr_no
      # mr_biotic_comp { microrelief component sampled, from obs table}
      
      # bind columns in reverse order - so last added is first
      microrelief_df_ex <- cbind(microrelief_df_ex, mr_biotic_comp = obs_df_ex$o_mr_sampled) # adds field to end
      microrelief_df_ex <- cbind(mr_no = 1, microrelief_df_ex)
      microrelief_df_ex <- cbind(o_id = obs_df_ex$o_id, microrelief_df_ex)
      microrelief_df_ex <- cbind(s_id = obs_df_ex$s_id, microrelief_df_ex)
      microrelief_df_ex <- cbind(proj_name = p_df_ex$proj_name, microrelief_df_ex)
      microrelief_df_ex <- cbind(proj_code = p_df_ex$proj_code, microrelief_df_ex)
      microrelief_df_ex <- cbind(proj_sa_agency_name = p_df_ex$proj_sa_agency_name, microrelief_df_ex)
      #microrelief_df_ex
      
      write.csv(x = microrelief_df_ex, file=paste0(getwd(),"/",p_df_ex$proj_code,"-microreliefs.csv"), row.names = FALSE)
      
      
      
      ### "SURF_CONDITIONS"
      
      ## All fields starting with scon go to SURF_CONDITIONS table
      sel_var_idx <- grep(pattern = "^scon_", x=names(so_df_ex))
      
      surf_cond_df_ex <- as.data.frame( so_df_ex[,sel_var_idx] )
      names(surf_cond_df_ex) <- names(so_df_ex)[sel_var_idx]
      
      # add leading columns for: 
      # proj_sa_agency_name
      # proj_code
      # proj_name
      # s_id
      # o_id
      # scon_no
      
      # bind columns in reverse order - so last added is first
      surf_cond_df_ex <- cbind(scon_no = 1, surf_cond_df_ex)
      surf_cond_df_ex <- cbind(o_id = obs_df_ex$o_id, surf_cond_df_ex)
      surf_cond_df_ex <- cbind(s_id = obs_df_ex$s_id, surf_cond_df_ex)
      surf_cond_df_ex <- cbind(proj_name = p_df_ex$proj_name, surf_cond_df_ex)
      surf_cond_df_ex <- cbind(proj_code = p_df_ex$proj_code, surf_cond_df_ex)
      surf_cond_df_ex <- cbind(proj_sa_agency_name = p_df_ex$proj_sa_agency_name, surf_cond_df_ex)
      #surf_cond_df_ex
      
      write.csv(x = surf_cond_df_ex,file=paste0(getwd(),"/",p_df_ex$proj_code,"-surf_conditions.csv"), row.names = FALSE)
      
      
      
      ### "SURF_COARSE_FRAGS"
      ## SCF1 abun, SCF1 lith, SCF1 size
      
      ## All fields starting with SCF1 go to SURF_COARSE_FRAGS table, with scf_no = 1
      sel_var_idx <- grep(pattern = "^SCF1", x=names(so_df_ex))
      
      surf_coarse_frags_df_ex <- as.data.frame( so_df_ex[,sel_var_idx] )
      names(surf_coarse_frags_df_ex) <- names(so_df_ex)[sel_var_idx]
      
      # standardise field names
      sel <- grep(pattern = "abun", x=names(surf_coarse_frags_df_ex))
      names(surf_coarse_frags_df_ex)[sel] <- "scf_abun"
      sel <- grep(pattern = "lith", x=names(surf_coarse_frags_df_ex))
      names(surf_coarse_frags_df_ex)[sel] <- "scf_lith"
      sel <- grep(pattern = "size", x=names(surf_coarse_frags_df_ex))
      names(surf_coarse_frags_df_ex)[sel] <- "scf_size"
      
      # add leading columns for: 
      # proj_sa_agency_name
      # proj_code
      # proj_name
      # s_id
      # o_id
      # scon_no
      
      # bind columns in reverse order - so last added is first
      surf_coarse_frags_df_ex <- cbind(scf_no = 1, surf_coarse_frags_df_ex)
      surf_coarse_frags_df_ex <- cbind(o_id = obs_df_ex$o_id, surf_coarse_frags_df_ex)
      surf_coarse_frags_df_ex <- cbind(s_id = obs_df_ex$s_id, surf_coarse_frags_df_ex)
