  output$so_tbl = DT::renderDataTable({
    if (is.null(dat())) {
      return(NULL)
    } else {
      
      ## Site observations: ENTRY NEEDED! - i.e. mandatory but missing?
      
      so_df <- dat()[["site-obs"]]    # so_df <- new[["site-obs"]]
      
      so_mand_flag <- matrix(ncol=length(names(so_df)),nrow=dim(so_df)[1] )
      colnames(so_mand_flag) <- names(so_df)
      
      for (i in 1:length(names(so_df))) {
        # what is the index for that variable?
        vrt_idx <- which(vrt$BulkAppLabel == names(so_df)[i])  #
        # is that variable mandatory?
        if (length(vrt_idx)==1) { mand <- ifelse(test=vrt$Mandatory[vrt_idx]=="Y" , yes=TRUE, no=FALSE)  }
        
        so_mand_flag[,i] <- as.logical(lapply(so_df[,i], FUN = function(x) {
          if (mand==TRUE & is.na(x)) {return(TRUE)}
          else {return(NA)}
        }))
      }
      
      target_cells_idx_mand <- which(so_mand_flag[]==TRUE ,arr.ind = TRUE)
      if (length(target_cells_idx_mand)>0) {
        so_df[target_cells_idx_mand] <- "ENTRY NEEDED!"
      }
      
      
      ## Site observations: INVALID! - i.e. not matching a code domain?
      
      so_code_flag <- matrix(ncol=length(names(so_df)),nrow=dim(so_df)[1] )
      colnames(so_code_flag) <- names(so_df)
      
      for (i in 1:length(names(so_df))) {
        #i<-18
        # what is the index for that variable?
        vrt_idx <- which(vrt$BulkAppLabel == names(so_df)[i])  # vrt$DBName[vrt_idx]
        
        # fix for name mismatches
        if (names(so_df)[i] %in% c("SCF1 abun","SCF2 abun")) { vrt_idx <- which(vrt$DBName == "scf_abun") }
        if (names(so_df)[i] %in% c("SCF1 lith","SCF2 lith")) { vrt_idx <- which(vrt$DBName == "scf_lith") }
        if (names(so_df)[i] %in% c("SCF1 size","SCF2 size")) { vrt_idx <- which(vrt$DBName == "scf_size") }
        
        # is there a code domain for that variable?
        if (length(vrt_idx)==1) { code_exists <- ifelse(test=!is.na(vrt$DBDomain[vrt_idx]) , yes=TRUE, no=FALSE)  }
        
        # disable for S desc by, O desc by ... later might be able to link into web service for valid member names(?)
        if (names(so_df)[i] %in% c("S desc by", "O desc by")) {code_exists <- FALSE}
        
        so_code_flag[,i] <- as.logical( lapply(so_df[,i], FUN = function(x) {
          # Allow valid codes or NA values
          if (code_exists==TRUE & !(x %in% c(NA,codes$CODE_VALUE[which(codes$CODE_DOMAIN==vrt$DBDomain[vrt_idx])] )) ) {return(TRUE)}
          else {return(NA)}
        }))
        
      }
      
      target_cells_idx_code <- which(so_code_flag[]==TRUE ,arr.ind = TRUE)
      so_df[target_cells_idx_code] <- "INVALID!"
      
      # this time include both missing-mandatory & invalid data !!
      
      out <- datatable(so_df, class="cell-border stripe", rownames = FALSE) %>%
        formatStyle(columns = names(so_df)[unique(c(target_cells_idx_mand[ ,"col"], target_cells_idx_code[ ,"col"]) )], 
                    background = styleEqual(c("ENTRY NEEDED!","INVALID!"), c("magenta","yellow")))
      
      return(out)
    
    }
    
  })
  
  
  
  output$hor_tbl = DT::renderDataTable({
    if (is.null(dat())) {
      return(NULL)
    } else {
      
      ## Site observations: ENTRY NEEDED! - i.e. mandatory but missing?
      
      h_df <- dat()[["horizons"]]
      
      h_mand_flag <- matrix(ncol=length(names(h_df)),nrow=dim(h_df)[1] )
      colnames(h_mand_flag) <- names(h_df)
      
      for (i in 1:length(names(h_df))) {
        # what is the index for that variable?
        vrt_idx <- which(vrt$BulkAppLabel == names(h_df)[i])  #
        # is that variable mandatory?
        if (length(vrt_idx)==1) { mand <- ifelse(test=vrt$Mandatory[vrt_idx]=="Y" , yes=TRUE, no=FALSE)  }
        
        h_mand_flag[,i] <- as.logical(lapply(h_df[,i], FUN = function(x) {
          if (mand==TRUE & is.na(x)) {return(TRUE)}
          else {return(NA)}
        }))
      }
      
      target_cells_idx_mand <- which(h_mand_flag[]==TRUE ,arr.ind = TRUE)
      h_df[target_cells_idx_mand] <- "ENTRY NEEDED!"
      
      
      ## Site observations: INVALID! - i.e. not matching a code domain?
      
      #### NEED TO FIX 

#       Primary colour
#       Mott hue v/c
#       Mottle colour
#       Carb class#
      
      
      
      h_code_flag <- matrix(ncol=length(names(h_df)),nrow=dim(h_df)[1] )
      colnames(h_code_flag) <- names(h_df)
      
      for (i in 1:length(names(h_df))) {
        # what is the index for that variable?
        vrt_idx <- which(vrt$BulkAppLabel == names(h_df)[i])  # vrt$DBName[vrt_idx]
        
        # fix for name mismatches
        if (names(h_df)[i] %in% c("CF1 abun","CF2 abun")) { vrt_idx <- which(vrt$DBName == "cf_abun") }
        if (names(h_df)[i] %in% c("CF1 lith","CF2 lith")) { vrt_idx <- which(vrt$DBName == "cf_lith") }
        if (names(h_df)[i] %in% c("CF1 size","CF2 size")) { vrt_idx <- which(vrt$DBName == "cf_size") }
        
        if (names(h_df)[i] %in% c("Seg1 abun","Seg2 abun")) { vrt_idx <- which(vrt$DBName == "seg_abun") }
        if (names(h_df)[i] %in% c("Seg1 nature","Seg2 nature")) { vrt_idx <- which(vrt$DBName == "seg_nature") }
        if (names(h_df)[i] %in% c("Seg1 form","Seg2 form")) { vrt_idx <- which(vrt$DBName == "seg_form") }
        if (names(h_df)[i] %in% c("Seg1 size","Seg2 size")) { vrt_idx <- which(vrt$DBName == "seg_size") }
        
        
        # is there a code domain for that variable?
        if (length(vrt_idx)==1) { code_exists <- ifelse(test=!is.na(vrt$DBDomain[vrt_idx]) , yes=TRUE, no=FALSE)  }
        
        # disable for Horizon ... fix later ... needs to receive entire Horizon descriptor and then break into parts(?)
        if (names(h_df)[i] == "Horizon") {code_exists <- FALSE}
        
        
        h_code_flag[,i] <- as.logical( lapply(h_df[,i], FUN = function(x) {
          # Allow valid codes or NA values

          if (code_exists==TRUE & !(x %in% c(NA,codes$CODE_VALUE[which(codes$CODE_DOMAIN==vrt$DBDomain[vrt_idx])],
                                             codes$CODE_DESC[which(codes$CODE_DOMAIN==vrt$DBDomain[vrt_idx])])) ) {return(TRUE)}
          else {return(NA)}
        }))
      }
      
      target_cells_idx_code <- which(h_code_flag[]==TRUE ,arr.ind = TRUE)
      h_df[target_cells_idx_code] <- "INVALID!"
      
      # this time include both missing-mandatory & invalid data !!
      
      out <- datatable(h_df, class="cell-border stripe", rownames = FALSE) %>%
        formatStyle(columns = names(h_df)[unique(c(target_cells_idx_mand[ ,"col"], target_cells_idx_code[ ,"col"]) )], 
                    background = styleEqual(c("ENTRY NEEDED!","INVALID!"), c("magenta","yellow")))
      
      return(out)
      
    }
    
  })
  
  
  
  
  output$lab_data = DT::renderDataTable({

    if (is.null(dat()[["lab results"]])) {
      return(NULL)
    } else {
      
      display_df <- dat()[["lab results"]]   # display_df <- new[["lab results"]]
      names_df <- names(display_df)
      units <- dat()[["lab units"]]          # units <- new[["lab units"]]
      new_names <- names_df
      
      for (i in 1:(length(names_df)-1)) {
        # skip 1st name as that is just unique lab identifier
        if (!is.na(units[i])) { new_names[1+i] <- paste0(new_names[1+i]," \n[",units[i],"]") }
      }
      
      names(display_df) <- new_names
      return( display_df )
    }

  })
  
  
    output$lab_method_check <- DT::renderDataTable({
      #if (is.null(lab_report())) {
      if (is.null(dat())) {
        return(NULL)
      } else {
        #return( lab_report()[["lab methods check"]] )
        return( dat()[["lab methods check"]] )
      }
    })
  
  
    output$search_codes_tbl <- DT::renderDataTable({
      
      codes_for_search <- as.data.frame( matrix( nrow=dim(codes)[1],ncol=4) )
      names(codes_for_search) <- c( "Field name", "CODE", "Description", "Code group" )
      
      codes_for_search$CODE <- codes$CODE_VALUE
      codes_for_search$Description <- codes$CODE_DESC
      codes_for_search$`Code group` <- codes$CODE_DOMAIN
      
      
      for (i in 1:dim(codes_for_search)[1]) {
        #
        newname_idx <- which( vrt$DBDomain == codes_for_search$`Code group`[i] )
        if (length(newname_idx)>=1) {
          codes_for_search$`Field name`[i] <- paste( vrt$BulkAppLabel[newname_idx], collapse = ";" )
        }
      }
      
      # clean-up unused rows
      codes_for_search$`Field name` <- gsub(pattern = ";NA", replacement = "",x = codes_for_search$`Field name`)
      codes_for_search$`Field name` <- gsub(pattern = "NA", replacement = NA,x = codes_for_search$`Field name`)
      sel.rm <- which(is.na(codes_for_search$`Field name`))
      
      codes_for_search <- codes_for_search[-sel.rm, ]
      
      
      ## add lab methods
      
      labm_codes_for_search <- as.data.frame( matrix( nrow=dim(lab_methods)[1],ncol=4) )
      names(labm_codes_for_search) <- c( "Field name", "CODE", "Description", "Code group" )
      
      labm_codes_for_search$`Field name` <- lab_methods$LABM_SHORT_NAME
      labm_codes_for_search$CODE <- lab_methods$LABM_CODE
      labm_codes_for_search$Description <- paste0(lab_methods$LABM_NAME," [units: ",ifelse(test=is.na(lab_methods$LABM_UNITS),yes="N/A",no=lab_methods$LABM_UNITS),"]")
      labm_codes_for_search$`Code group` <- lab_methods$LABP_CODE
      
      
      codes_for_search <- rbind(codes_for_search, labm_codes_for_search)
      #rownames(codes_for_search) <- NULL
      
    })
    
    


    
  ## Map of sites
  output$map <- renderLeaflet({
    
    #if (is.null( data() ))
    #  return(NULL)
    
    if ( is.null( dat() ) ) {
      
      # base map ONLY
      leaflet() %>%
        #setView(lng = 134, lat = -27, zoom=10) %>%    # -27.410202, 134.370047
        addTiles() %>%
        fitBounds(lng1 = 111, lat1 = -44, lng2 = 155, lat2 = -10 )
      
    } else {
      
      
      lat <- dat()[["site-obs"]]$`Latitude (y)`  # o_latitude_gda94
      lon <- dat()[["site-obs"]]$`Longitude (x)`   # o_longitude_gda94
      
      site_id <- paste0("Site ",dat()[["site-obs"]]$`S ID`,"; Obs ",dat()[["site-obs"]]$`Obs no`)   # s_id
      
      
      # base map + data() sites
      leaflet() %>%
        addTiles() %>% # OpenStreetMaps is loaded by default - #http://trendct.org/2015/06/26/tutorial-how-to-put-dots-on-a-leaflet-map-with-r/
        
        # add sites
        #addMarkers(lng = data()[,3], lat = data()[,2] , popup = paste("Site #",data()[,1],":  ",data()[,4],sep="" ), group = "Sites"  ) %>%
        addMarkers(lng = lon, lat = lat , popup = site_id, group = "Sites"  ) %>%
        
        
        #fitBounds(lng1 = min(data()[,3]), lat1 = min(data()[,2]), lng2 = max(data()[,3]), lat2 = max(data()[,2]) )
        fitBounds(lng1 = min(lon), lat1 = min(lat), lng2 = max(lon), lat2 = max(lat) )
    }
    
  })
  
  

  
  click_coord_x_long <- reactive({
    
    ## Get the click info
    click <- input$map_click
    #clat <- click$lat
    clng <- click$lng
    
    if (is.null( click )) {
      return(NULL)
      
    } else {
      return(clng)
    }
  })
  
  
  click_coord_y_lat <- reactive({
    
    ## Get the click info
    click <- input$map_click
    clat <- click$lat
    #clng <- click$lng
    
    if (is.null( click )) {
      return(NULL)
      
    } else {
      return(clat)
    }
  })
  
  
  
  observeEvent(input$map_click, {
    ## Get the click info from map object
    click <- input$map_click
    clat <- click$lat
    clng <- click$lng
    
    ## Add the circle to the map proxy
    ## so you dont need to re-render the whole thing
    ## I also give the circles a group, "circles", so you can
    ## then do something like hide all the circles with hideGroup('circles')
    #https://stackoverflow.com/questions/34348737/r-leaflet-how-to-click-on-map-and-add-a-circle  
    
    leafletProxy('map') %>% # use the proxy to save computation
      addCircles(lng=clng, lat=clat, #group='draft sites',
                 weight=5, radius=100, color='orange', # fillColor='orange',     blue = #03F   red = #a50f15
                 #            #popup=address, fillOpacity=0.5, opacity=1)
                 fillOpacity=0.2, opacity=0.5)
    
  })
  
  
  
  ## Show map click coordinates
  output$map_click_coords <-  renderText({
    
    click <- input$map_click
    
    if (is.null( click )) {
      return(NULL)
      
    } else {
      print(paste0("Latitude: ",click_coord_y_lat(),", Longitude: ",click_coord_x_long() ))
      
    }
    
  })
  
  
  
  
  
  
  
