      zip(zipfile = tmpfile, files= downloadZipFilenames(),flags = "-j0X", zip="zip" ) # "zip.exe" from RTools copied here -- C:\Program Files\R\R-3.2.1\bin\x64
      
    },
    contentType = "application/zip"
  )
  
  
  
  
  
  
